import { createMultisigSetTimeLockInstruction } from "../generated";
export function multisigSetTimeLock({ multisigPda, configAuthority, timeLock, memo, programId, }) {
    return createMultisigSetTimeLockInstruction({
        multisig: multisigPda,
        configAuthority,
    }, {
        args: {
            timeLock,
            memo: memo ?? null,
        },
    }, programId);
}
